import React from 'react';

const DeviceItem = ({device}) => {
    console.log(device.name)
    return (
        <div className='d-flex m-4 mt-0'>
            <div className="d-flex p-3 row border rounded-3" style={{width: '16rem',cursor:'pointer'}}>
                <img style={{width:'95%', height:'50%'}} src={device.img} className="card-img-top" alt="..."/>
                <div className="card-body">
                    <h5 className="card-title mt-">{device.name}</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    );
};

export default DeviceItem;
